import React from "react";
import styled from "styled-components";

const Home = (props) => {
  return <Container>Home</Container>;
};

const Container = styled.main`
  position: relative;
  background-image: url("/images/home-background.png");
  min-height: calc(100vh - 250px);
  overflow-x: hidden;
  display: block;
`;

export default Home;
